k = int(sys.stdin.readline())
r = int(sys.stdin.readline())

ans = 0
while k > 0:
    ans += k // 10
    k %= 10
    if k == 0:
        break
    ans += 1
    k -= r

print(ans)






























































































































































































































































































































































































